import React from "react";
import "./footer.css";

import { Link } from "react-router-dom";

const Footerr = () => {
  return (
    <div className="footer">
      SY Makina A.Ş. 2021 Bütün Hakları Saklıdır.
      <Link className="footer2">Designed by K.Ş</Link>
    </div>
  );
};

export default Footerr;
